var keys = _.keys(cars[0]);
var number_of_scales = _.map(keys, function(k) {return 1;}); // default all axis 1 scale
var type_of_scaling  = _.map(keys, function(k) {return "naive";}); // default all axis 1 scale

var min_max = _.map(keys, function(k){
   var all_values = _.pluck(cars, k);
   return [_.min(all_values), _.max(all_values)];
});

var all_power = _.pluck(cars, 'power (hp)');
var stat = jStat(all_power);

var median = stat.median();
var mean = stat.mean();
var skewness = stat.skewness(); // +ve right skewness; -ve left skewness; 0 normal
var skw_threshold = 0.3; // less than which on both side makes this assume normal distribution

var normal =  Math.abs(skewness) < skw_threshold;
var domain = [];
var range  = [];
if (!normal){
    var rightSkwd = skewness > 0;

    if (rightSkwd){
        // min, median + 2 * stdev, max
        domain = [stat.min (), mean + stat.stdev(), stat.max()];
        range  = [0, 75, 100];
    } else {
        // left skewed
    }

} else {
    console.log("power normal");
}

// 0-60 mph(s)
var all_power = (function(){
    d = [];
    for (c in cars){
        d.push(cars[c]['t0t60 mph(s)']);
    }
    return d;
})();

var stat = jStat(all_power);

var median = stat.median();
var mean = stat.mean();
var skewness = stat.skewness(); // +ve right skewness; -ve left skewness; 0 normal

var normal =  Math.abs(skewness) < skw_threshold;
var domain2 = [];
var range2  = [];
if (!normal){


}else{
    console.log('0 to 60 is normal distribution');

    domain2 = [stat.min(), mean - stat.stdev(), mean + stat.stdev(), stat.max()];
    range2  = [0, 25, 75, 100];
}


var popt = {
  'categorical':["name", "colour"],
    'power (hp)':[domain, range],
    't0t60 mph(s)':[domain2, range2]
};
buildParallelCoordinates(cars, popt, []);

function toggleLogic() {

   var toggle_array = []

   if ($("#power").is(":checked")){
       toggle_array.push('power (hp)');
   }

   if ($("#t0t60").is(":checked")){
       toggle_array.push('t0t60 mph(s)');
   }

   console.log(toggle_array);
   $("#mainSvgID").remove();
   buildParallelCoordinates(cars, popt, toggle_array);
}

$(document).ready(function(){
   $('#power').click(toggleLogic);

   $('#t0t60').click(toggleLogic);

});
